import React from 'react';
import styled from 'styled-components';

const SectionTitleStyle = styled.div`
  text-align: center;
  p{
      font-family:"RobtoMono Regular"
  }
`;

export default function SectionTitle() {
  return (
    <div>
      <p>this is subtitle</p>
      <h2>this is title</h2>
    </div>
  );
}
